import React from "react";
import ReactDOM from "react-dom";

import "./styles.css";

class App extends React.Component {
  render() {
    return (
      <div className="App">
        <p>Navigation </p>
        <p>Logo </p>
        <p>Rank </p>
        <p>ImageLinkForm </p>
        <p>FaceRecognition </p>
      </div>
    );
  }
}

const rootElement = document.getElementById("root");
ReactDOM.render(<App />, rootElement);
